import Todolists from './router/todolists.js';
import { BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
      <Switch>
        <Route path='/' exact component={Todolists} />
        <Route path='' exact component={Todolists} />
      </Switch>
      </div>
    </Router>
  );
}

export default App;
